import React from 'react';
import './Boxes.css';

const Boxes = ({box}) => {
    return(
        <div 
            className='peter' 
            style={{
                top:box[0].region_info.bounding_box.topRow, 
                right: box[0].region_info.bounding_box.rightCol, 
                left: box[0].region_info.bounding_box.leftCol, 
                bottom:box[0].region_info.bounding_box.bottomRow
            }}
        ></div>
    )
} 

export default Boxes;
